import 'bootstrap/dist/css/bootstrap.min.css';
import React, { Component } from 'react';
import './App.css';
import Navbar from './components/Navbar';     


class App extends Component {
  render() {

    return (
      <div className="App">
        <header className="">
          <Navbar/>
          {this.state.title}
        </header>
      </div>
    );
  }
}

export default App;
